import React from 'react'
import ResumeItem from '../ResumeItem'
import * as C from './styles'
import {
    FaRegArrowAltCircleUp,
    FaRegArrowAltCircleDown,
    FaDollarSign
} from 'react-icons/fa';

const Resume = () => {
  return (
    <C.Container>
        <ResumeItem title='In' Icon={FaRegArrowAltCircleUp} value='100'/>
        <ResumeItem title='Out' Icon={FaRegArrowAltCircleDown} value='100'/>
        <ResumeItem title='Total' Icon={FaDollarSign} value='1020'/>
    </C.Container>
  )
}

export default Resume
